import React from 'react';
import styled from "styled-components";

const Container = styled("div")`
padding:20px;
`;

const NormalContainer = styled("div")`

`;

const FlexContainer = styled(NormalContainer)`
display:flex;
justify-content:space-around;
`;

const CardContainer = styled(FlexContainer)`
margin-bottom:10px;
background: #FFFFFF;
border: 1px solid #F8B219;
box-sizing: border-box;
border-radius: 5px;
`;

const Text = styled("p")`
font-family: Open Sans;
font-style: normal;
font-weight: normal;
font-size: 14px;
line-height: 19px;
color: #444444;

`;

const Title = styled(Text)`
font-weight: bold;
padding-top:10px
`;

const Image = styled("img")`

`;


const vehicles = [{
    imageUrl: require("../../assets/images/cars/vehicles/economy.svg"),
    name: "Economy",
    capacity: "4",
    price: "122",
    currency: "Birr",
}];

const VehicleList = () => {
    return (
        <>
            <Container>
                <Title>Select Vehicle</Title>

                {vehicles.map((vehicle) => (
                    <CardContainer key={vehicle.name}>

                        <FlexContainer>
                            <Image src={vehicle.imageUrl}/>
                            <NormalContainer>
                                <Text>{vehicle.name}</Text>
                                <FlexContainer>
                                <Image src={vehicle.imageUrl}/>
                                <Text>{vehicle.capacity}</Text>
                                </FlexContainer>

                            </NormalContainer>

                        </FlexContainer>

                    </CardContainer>
                ))}
            </Container>

        </>
    );
}

export default VehicleList;
